drop table if exists dp_ConsultaPersonalizada;
CREATE TABLE dp_ConsultaPersonalizada (
idConsultaPer int NOT NULL PRIMARY KEY auto_increment,
idVeterinario int NOT NULL,
idCliente int not null,
motivo varchar(255) not null,
fechaAtencion date not null,
idMascota int,
idHora int,
monto float not null default '55.00',
estadoAtencion int not null default 0,
estadoPago int not null default 0, 
Fecha_registro Datetime not null default CURRENT_TIMESTAMP,
foreign key (idMascota) references DP_Mascota(idMascota),
foreign key (idCliente) references DP_Cliente(idCliente),
foreign key (idHora) references dp_Hora(idHora),
foreign key (idVeterinario) references dp_Veterinarios(idVeterinario)
);

drop table if exists Comentarios;
CREATE TABLE Comentarios (
idComentario int NOT NULL PRIMARY KEY auto_increment,
nombre varchar(255) not null,
apellidos VARCHAR(255) not null,
comentario varchar(255) not null,
fechaC Datetime not null default CURRENT_TIMESTAMP
);

drop table if exists dp_PagoConsultaPersonalizada;
CREATE TABLE dp_PagoConsultaPersonalizada (
idPagoConsultaPer int NOT NULL PRIMARY KEY auto_increment,
idCliente int not null,
idConsultaPer int not null,
celular varchar(25) not null,
celularAl varchar(25) not null,
dni char(8) not null,
evidenciaPago longblob NOT NULL,
cartera varchar(25) not null,
monto float not null,
Fecha_registro Datetime not null default CURRENT_TIMESTAMP,
foreign key (idCliente) references DP_Cliente(idCliente),
foreign key (idConsultaPer) references dp_ConsultaPersonalizada(idConsultaPer)
);




