drop procedure if exists SP_InsertarConsulta;
	delimiter $$
	create procedure SP_InsertarConsulta
	(in 
	nombreCli varchar (50),
	TelefonoCons char(9),
	FechaCons date,
	correoCli varchar(100),
	Motivo varchar(200))
	begin
	insert into DP_Consulta(nombreCli,TelefonoCons,FechaCons,correoCli,Motivo) 
	values(nombreCli,TelefonoCons,FechaCons,correoCli,Motivo);
	end $$
	delimiter ;

drop procedure if exists SP_InsertarReserva;
	delimiter $$
	create procedure SP_InsertarReserva
	(in 
	idVeterinario int,
	idCliente int,
	motivo  varchar(255),
	fechaAtencion  date,
	idMascota  int,
   idHoraP int)
	begin
	insert into dp_ConsultaPersonalizada(idVeterinario,idCliente,motivo,fechaAtencion,idMascota,idHora) 
	values(idVeterinario,idCliente,motivo,fechaAtencion,idMascota,idHoraP);
   update dp_Hora set estado = 0 where idHora=idHoraP;
	end $$
	delimiter ;

drop procedure if exists SP_RegistrarPagoReserva;
	delimiter $$
	create procedure SP_RegistrarPagoReserva
	(in 
	idCliente int,
	idConsultaPerS int,
	celular varchar(25),
	celularAl varchar(25),
	dni char(8),
	evidenciaPago  longblob,
	cartera  varchar(25),
	montoP float
	)
	begin
	insert into dp_PagoConsultaPersonalizada(idCliente,idConsultaPer,celular,celularAl,dni,evidenciaPago,cartera,monto) 
	values(idCliente,idConsultaPerS,celular,celularAl,dni,evidenciaPago,cartera,montoP);
   	update dp_ConsultaPersonalizada set estadoPago = 1, monto = monto - montoP where idConsultaPer=idConsultaPerS;
	end $$
	delimiter ;				

drop procedure if exists SP_Login;
DELIMITER $$
create PROCEDURE SP_Login(in
_email varchar(100),
_clave varchar(50)
)
BEGIN
	DECLARE res INT;
    select count(*) into res from dp_cliente where Email like _email;
	IF res = 0 THEN
		select -1;
	ELSE
		select count(*) into res from dp_cliente where Password like _clave;
		IF res = 0 THEN
			select -2;
		ELSE
			select * from dp_cliente
			where Email like _email and Password like _clave;
		END IF;
	END IF;
End$$
DELIMITER ;


